--
-- Structure de la vue `facturation_corporate`
--
DROP TABLE IF EXISTS `facturation_corporate`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `facturation_corporate`  AS   (select distinct `d`.`id` AS `id`,`d`.`datebl` AS `datebl`,`d`.`ref_es` AS `ref_es`,`d`.`ref_gaz` AS `ref_gaz`,`d`.`designation_es` AS `des_es`,`d`.`designation_gaz` AS `des_gaz`,`d`.`qte_es` AS `qte_es`,`d`.`qte_gaz` AS `qte_gaz`,`d`.`corporates_id` AS `corporates_id`,`p`.`nom` AS `prestataire`,`p`.`nom_chauffeur` AS `nom_chauffeur`,`c`.`nom` AS `client`,`c`.`remise_essence` AS `remise_essence`,`c`.`remise_gazoil` AS `remise_gazoil`,`c`.`contact1` AS `contact1`,`c`.`localisation` AS `localisation`,`c`.`id` AS `clientCorpId`,`c`.`num_doc` AS `DFE`,`i`.`pue` AS `pue`,`i`.`pug` AS `pug` from ((((`doci_prixpompe_init` `i` join `doci_bonlivraison` `b`) join `doci_clientcorporates` `c`) join `doci_corporate_directe` `d`) join `doci_prestataire` `p`) where `c`.`id` = `d`.`corporates_id` and `d`.`accepter` = 1 and `p`.`id` = `d`.`prestataire_id`)  ;

-- --------------------------------------------------------

--
-- Structure de la vue `facturation_corporateold`
--
DROP TABLE IF EXISTS `facturation_corporateold`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `facturation_corporateold`  AS   (select `b`.`id` AS `id`,`b`.`datebl` AS `datebl`,`b`.`ref_es` AS `ref_es`,`b`.`ref_gaz` AS `ref_gaz`,`b`.`designation_es` AS `des_es`,`b`.`designation_gaz` AS `des_gaz`,`b`.`qte_es` AS `qte_es`,`b`.`qte_gaz` AS `qte_gaz`,`c`.`nom` AS `client`,`c`.`remise_essence` AS `remise_essence`,`c`.`remise_gazoil` AS `remise_gazoil`,`p`.`nom` AS `prestataire`,`p`.`nom_chauffeur` AS `nom_chauffeur`,`c`.`contact1` AS `contact1`,`c`.`localisation` AS `localisation`,`c`.`num_doc` AS `DFE`,`i`.`pue` AS `pue`,`i`.`pug` AS `pug` from (((`doci_prixpompe_init` `i` join `doci_bonlivraison` `b`) join `doci_clientcorporates` `c`) join `doci_prestataire` `p`) where `c`.`stations_id` = `b`.`station_id` and `b`.`prestataire_id` = `p`.`id` and `b`.`accepter` = 1)  ;

